import { Container, Button, Card } from 'react-bootstrap';

class Far extends Component {
    state = { 
        name: "nasir",
        bttext: "I am a big button"
     };


    render() { 
        return ( 
        <div>
            <Card style={{ width: '18rem' }}>Hello\n jpw ahfhash
            hasjfg ashjgf
            dgjksda kjhgd
             djkgfjhas</Card>
            <Container fluid>
            <Button variant="outline-success">{this.state.name}</Button>{' '}
            </Container>
        </div>
        );
    }
}

export default Far;
